PRAGMA defer_foreign_keys=TRUE;
CREATE TABLE forecast_items (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    published_at TEXT NOT NULL,
    forecast_date TEXT NOT NULL,
    min_temp INTEGER,
    max_temp INTEGER,
    wind_speed INTEGER,
    wind_direction TEXT,
    description TEXT,
    wind_details TEXT,
    visibility TEXT,
    visibility_code TEXT,
    comments TEXT,
    guid TEXT UNIQUE NOT NULL,
    created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
    rainfall TEXT,
    rainfall_min REAL,
    rainfall_max REAL
);
DELETE FROM sqlite_sequence;
CREATE INDEX idx_forecast_date on forecast_items (forecast_date);
CREATE INDEX idx_published_at on forecast_items (published_at);
CREATE INDEX idx_guid on forecast_items (guid);
